import React, {createContext, useEffect, useState} from "react";
import JoinForm from "./component/js/form/JoinForm";
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Main from "./component/js/Main";

function NotFound() {
    return null;
}

function App() {
    const [userId, setUserId] = useState(-1);

    useEffect(()=> {
        return (
            <div className="App">
                <BrowserRouter>
                    <Routes>
                        <Route path="/" element={<JoinForm setUserId={setUserId}/>}></Route>
                        <Route path="/main/*" element={<Main userId={userId}/>}></Route>
                        <Route path="*" element={<NotFound />}></Route>
                    </Routes>
                </BrowserRouter>
            </div>
        );
    }, [userId]);
    // return (
    //     <div className="App">
    //         <BrowserRouter>
    //             <Routes>
    //                 <Route path="/" element={<JoinForm setUserId={setUserId}/>}></Route>
    //                 <Route path="/main/*" element={<Main userId={userId}/>}></Route>
    //                 <Route path="*" element={<NotFound />}></Route>
    //             </Routes>
    //         </BrowserRouter>
    //     </div>
    // );
}

export default App;
